import React from "react";
import { Button , Container} from 'react-bootstrap';
let Footer = () => {
    return (
        <div className="section-footer">
            <Container>
                <div className="content-footer">
                <img width="200px" src='/logo2.png'/>

                <ul>
                    <li>HOME</li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
                </div>
            </Container>
        </div>
    )
}

export default Footer
